import React from 'react';
import './AnimeCatalog.css';

const AnimeCatalog = () => {
  // Exemplo de animes. Você pode expandir isso com dados reais.
  const animes = [
    {
      title: 'Anime 1',
      episodes: 12,
      synopsis: 'Sinopse do Anime 1',
      image: 'https://via.placeholder.com/150', // Substitua pelo link da imagem real
    },
    {
      title: 'Anime 2',
      episodes: 24,
      synopsis: 'Sinopse do Anime 2',
      image: 'https://via.placeholder.com/150', // Substitua pelo link da imagem real
    },
    // Adicione mais animes aqui
  ];

  return (
    <div className="anime-catalog">
      <h1>Catálogo de Animes</h1>
      <div className="anime-cards">
        {animes.map((anime, index) => (
          <div key={index} className="anime-card">
            <img src={anime.image} alt={anime.title} />
            <h2>{anime.title}</h2>
            <p>{anime.synopsis}</p>
            <p>Número de episódios: {anime.episodes}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default AnimeCatalog;
